import React from "react";
import Product from './Product';

function Store() {
    const productName = 'SMARTPHONE';
    const productPrice = '$ 26000.00';
    const productDescription = 'A powerful & Slet smartphone with Advanced Fearures';

    return (
        <>
        <h1>WELCOME TO OUR STOREEEEE!!!!</h1>
        <Product name={productName} price={productPrice} description={productDescription}/>
        </>
    );
}
export default Store;
